(5765, 'zhTW', '在英雄難度中，用神廟老鼠餵食4隻比塞克黑豹後擊敗高階祭司基爾娜拉。', '貓貓，貓貓，來這裡...', '', 56647),
(5762, 'zhTW', '英雄難度中，在未擊殺奧根的情況下擊敗祖爾格拉布的血領主曼多基爾。', '別急啦奧根', '', 56647),
(5761, 'zhTW', '在英雄難度中，在祖阿曼中為所有潛在的妖術受害者解除法術。', '妖術大調和', '', 56647),
(5760, 'zhTW', '在英雄難度中，在沒有任何玩家離開中心地板矩形綠松石圈的情況下擊敗祖阿曼的達卡拉。', '敲響喪鐘！', '', 56647),
(5759, 'zhTW', '在英雄難度中，在祖爾格拉布與金度交鋒過程期間，於15秒內擊敗20個扭曲之靈。', '靈魂扭曲者', '', 56647),
(5750, 'zhTW', '在英雄難度中，在未擊殺任何哈拉齊圖騰的情況下擊敗祖阿曼的哈拉齊。', '井蛙之見', '', 56647),
(5744, 'zhTW', '在英雄難度中，擊敗祖爾格拉布的古布、莫爾塔克斯、考勒瑪、摩勒克、叢翼蜂后、失落的加茲蘭卡後代、托通和古拉巴什大廚師。', '古拉巴什獵頭者', '', 56647),
(5743, 'zhTW', '在英雄難度中，在不被血毒、刺激性淚池、或滲流毒液擊中的情況下擊敗祖爾格拉布的高階祭司溫諾希斯。', '要變綠可不容易', '', 56647),
(5505, 'zhTW', '在英雄難度中，以漫天彈幕擊敗12個嗜血食屍鬼，並擊敗影牙城堡的高佛雷領主。', '子彈時間', '', 56647),
(5504, 'zhTW', '在英雄難度中，於不讓斯普林瓦爾接收任何穢邪活化的情況下，擊敗影牙城堡的指揮官斯普林瓦爾。', '躺地板吧你！', '', 56647),
(5503, 'zhTW', '在英雄難度中，在不讓艾胥柏利使用暫緩死刑治療的情況下，擊敗影牙城堡的艾胥柏利男爵。', '緩刑駁回', '', 56647),
(5371, 'zhTW', '在英雄難度中，於夢魘藥劑生效後的5分鐘內與凡妮莎‧范克里夫在死亡礦坑進行戰鬥。', '充滿活力的范克里夫復仇者', '', 56647),
(5370, 'zhTW', '在英雄難度中，在不得到超過一層作嘔效果的情況下擊敗死亡礦坑中的餅乾。', '我在減肥', '', 56647),
(5369, 'zhTW', '在英雄難度中，在死亡礦坑與利普斯納爾上將交鋒過程期間，讓三個冰冷蒸氣全部施放接合。', '這就是冰霜傷害', '', 56647),
(5368, 'zhTW', '在英雄難度中，於收割者原型機的生命力上限一直不低於90%的情況下擊敗死亡礦坑的敵人收割者5000型。', '原型機天才', '', 56647),
(5367, 'zhTW', '在英雄難度中，在死亡礦坑中與赫利克斯‧碎輪者的戰鬥中殺死20隻礦坑老鼠。', '鼠黨', '', 56647),
