(5298, 'zhTW', '在英雄難度中，在不讓無面墮落者對任何雅立史卓莎的蛋施放暮光腐化的情況下，擊敗格瑞姆巴托的伊魯達克斯。', '不用蛋也能做煎蛋捲', '', 56647),
