(2435, 'zhTW', '法力閃焰', '每次你受到直接傷害時，會對敵人造成[StandardDamage(1,1,2436)]點[School()]傷害。\n\n持續[duration(1,1)]輪。', 56647),
(2378, 'zhTW', '聖光光束', '[StandardAccuracy(1,1)] |cffffffff命中機率|r\n\n對敵方啟用的寵物造成[StandardDamage(1,1)]點[School()]傷害，並對敵方後排寵物造成[StandardDamage(1,2)]點[School()]傷害。為所有盟友回復[StandardHealing(1,1)]點生命力。', 56647),
(1369, 'zhTW', '倒鉤毒刺', '[StandardAccuracy(1,1)]|cffffffff命中機率|r\n\n立即造成[StandardDamage(1,1)]點[School()]傷害，並有20%的機率使目標|cFF1EFF00中毒|r，每輪額外造成[StandardDamage(1,1,379)]點[School(379)]傷害，持續[duration(1,2)]輪。', 56647);
INSERT INTO `battle_pet_species_locale` (`ID`, `locale`, `Description_lang`, `SourceText_lang`, `VerifiedBuild`) VALUES
(3265, 'zhTW', '這真的是最有威嚴的臭鬃牛了。', '|cFFFFD200成就：|r好東西都小小的', 56647),
(4517, 'zhTW', '在夢境與願望的奇蹟之下，蠟芯甦醒了過來，並從狗頭人的頭上爬下來，以追尋她自己的道路。', '|cFFFFD200成就：|r卡茲阿爾加狩旅團|n', 56647),
(4581, 'zhTW', '', '|cFFFFD200成就：|r勇士的旅程：地心之戰|n|cFFFFD200類別：|r世界', 56647),
(4543, 'zhTW', '自從芬利‧莫戈頓爵士在一次探險中偶然遇到這隻生物後，它就形影不離地跟著他了。芬利爵士漸漸喜歡上這個暗影夥伴，也絕不會輕易離它而去。', '|cFFFFD200商人：|r芬利‧莫戈頓爵士|n|cFFFFD200區域：|r多恩諾加|n|cFFFFD200花費：|r10000|Hcurrency:2803|h|TInterface\\ICONS\\INV_Misc_ElvenCoins.blp:0|t|h', 56647);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(268268, 'zhTW', '', '這是聖焰的意志，但我很懷疑。', 56647),
(259733, 'zhTW', '', '你是下一個。', 56647),
(260378, 'zhTW', '', '謝謝你，父親。希望那個時刻不會那麼快到來。', 56647),
(260375, 'zhTW', '等我走了，你將會繼位，用我望塵莫及的領導能力統治王國。', '', 56647),
(260374, 'zhTW', '但你不再需要我了。看到你這麼堅強，我很欣慰。', '', 56647),
(260371, 'zhTW', '我只是想保護你。但我做得太差勁了。我們現在的處境還是很危險。', '', 56647),
(260345, 'zhTW', '', '我無法徹底原諒你，但我可以理解你。', 56647),
(260336, 'zhTW', '', '但隨著我更加成熟，達格蘭逐漸長大，我也對領導能力更加了解…', 56647),
(260333, 'zhTW', '', '我想再說一次，我如何看待你對小時候的我做的事…對達格蘭的父親做的事。', 56647),
(260303, 'zhTW', '儘管如此，你還是成為了一個優秀的統治者，還讓達格蘭成為了一個男子漢。', '', 56647),
(260294, 'zhTW', '那是我自作自受。我做了一些令人羞愧的事。', '', 56647),
(260287, 'zhTW', '', '你說什麼？我從沒想到你會冒出這句話。你是不是生病了？', 56647),
(260283, 'zhTW', '我只是想說…我以你為傲。', '', 56647),
(260266, 'zhTW', '我看得出來。你比我更會跟這些…機器人相處。', '', 56647),
(260265, 'zhTW', '', '別擔心，父親。一切都在我的掌控中。', 56647),
(260264, 'zhTW', '茉艾拉，我可以跟你說件事嗎？', '', 56647),
(263779, 'zhTW', '媽，謝謝你。我…不知道該說什麼…但我很期待能和你一起發現新事物。', '', 56647),
(263778, 'zhTW', '', '我可不會想跟別人一起經歷城市墜毀、認識新朋友和跳進黑暗深洞。', 56647),
(263777, 'zhTW', '', '你是我們族人的未來，你能為這個世界帶來很多貢獻，別讓任何人動搖你的心志。', 56647),
(263776, 'zhTW', '', '好幾個小時？我可以聽你說好幾天。你是我兒子，我這麼說可能有失公正，但你擁有很優秀的思想。', 56647),
(263775, 'zhTW', '真的嗎？有的時候你問我問題…而如果我對你問的主題很有興趣的話，我可能會說上好幾個小時…', '', 56647),
(263774, 'zhTW', '', '你對歷史一直都有不錯的造詣…還有文化。我都已經把你當成是顧問了。', 56647),
(263773, 'zhTW', '', '很好。我不想要讓你陷入險境，但我很高興看到你也對冒險這麼感興趣。', 56647),
(263772, 'zhTW', '不了，媽。我在這裡學到了很多知識。世界感覺是如此的新奇…同時又很古老。', '', 56647),
(263771, 'zhTW', '', '達格蘭，你準備好了嗎？其實你沒必要下去，你想的話可以待在文庫裡。', 56647),
(260591, 'zhTW', '', '多恩諾加失去了保護者，我失去了…朋友。', 56647),
(260588, 'zhTW', '', '我總是不禁認為，如果我們其中一個人不是那麼死腦筋，他或許就不用死。', 56647),
(260584, 'zhTW', '', '我把多恩諾加丟給他一個人，我以為他永遠不會原諒我，最終卻是…', 56647),
(260582, 'zhTW', '', '我認為必須脫離泰坦。他則說我們比以前更需要泰坦。', 56647),
(260580, 'zhTW', '', '我看到這對我們族人的影響。貝格姆也一樣。', 56647),
(260579, 'zhTW', '', '但一切逐漸開始…變調。在我們針鋒相對的時候，地心通途、文庫紛紛開始出問題。', 56647),
(260578, 'zhTW', '', '我們兩個都對多恩諾加不可或缺。', 56647),
(260576, 'zhTW', '', '我們就像兩隻公羊一樣，鬥來鬥去，他帶著他的風暴禿鼻鴉，我賭上我的礦場和熔爐。', 56647),
(260573, 'zhTW', '', '我們互相比較各自獲得的成就和綬章。比較誰最受泰坦的青睞。', 56647),
(260566, 'zhTW', '', '我和貝格姆是對手。我們兩個在同一時間成為守衛。', 56647),
(276521, 'zhTW', '在任意探究的最後打開沉重的箱子、豐碩寶庫或是隱藏寶藏箱將可使你獲得探究旅程的進度並藉此換取我們發現的獎勵。\n\n完成的探究越困難，取得的進度也就越多！', '', 56647),
(264632, 'zhTW', '', '哈哈！哈哈哈！', 56647),
(263040, 'zhTW', '這棵樹真是太神奇了！它原本還有點枯萎，但那隻螃蟹一出現，它的葉子就恢復了一些顏色。真是奇怪！\n\n如果我有更多螃蟹，或許我就能讓它恢復生氣。牠們似乎很喜歡樹！', '這棵樹真是太神奇了！它原本還有點枯萎，但那隻螃蟹一出現，它的葉子就恢復了一些顏色。真是奇怪！\n\n如果我有更多螃蟹，或許我就能讓它恢復生氣。牠們似乎很喜歡樹！', 56647),
(263507, 'zhTW', '偵測到未知異象。啟動甦醒淨化程序。', '', 56647),
(258213, 'zhTW', '通過這個傳送門到下方的卡茲阿爾加。那些逃出的人仍需要幫助。', '', 56647),
(266134, 'zhTW', '知道了，布萊恩叔叔！你想讓我試著和牠戰鬥嗎？', '', 56647),
(253394, 'zhTW', '我相信一切盡在瓦爾罕公爵的掌握之中。他是個偉大的領袖！\n\n你知道嗎，正是因為有他的率領，阿拉希在瓦爾罕殞命之地的傷亡才相對較少。', '我相信一切盡在瓦爾罕公爵的掌握之中。他是個偉大的領袖！\n\n你知道嗎，正是因為有他的率領，阿拉希在瓦爾罕殞命之地的傷亡才相對較少。', 56647),
(268948, 'zhTW', '', '<感到有趣的輕笑>', 56647),
(268647, 'zhTW', '', '戰爭魔像開始活動，產線也恢復了。', 56647),
(265314, 'zhTW', '', '設施重新啟動！', 56647),
(265313, 'zhTW', '小隊，打包閃人！我知道何時該撤退…', '', 56647),
(265081, 'zhTW', '', '如果她能對晉升者這麼做…', 56647),
(265078, 'zhTW', '', '她一眨眼就奪走了伊特希的心智。', 56647),
(265077, 'zhTW', '', '快走啊！', 56647),
(263478, 'zhTW', '', '已經完成。', 56647),
(263476, 'zhTW', '', '你的晉升儀式…', 56647),
(260586, 'zhTW', '', '吉吉，上！', 56647),
(260581, 'zhTW', '', '你猜如何？我們的確有帶。', 56647),
(260577, 'zhTW', '看樣子你應該帶更大的朋友過來。', '', 56647),
(261892, 'zhTW', '', '我們有一大堆事要做。', 56647),
(261891, 'zhTW', '蘆瑟菈，接下來呢？', '', 56647),
(261890, 'zhTW', '', '牠們憑藉自己的自由意志選擇幫助我們。', 56647),
(261889, 'zhTW', '', '不只是我的，還有他們的。', 56647),
(261888, 'zhTW', '做得好。風暴禿鼻鴉響應了你的召喚。', '', 56647),
(261884, 'zhTW', '召喚牠們，牠們就會響應。', '', 56647),
(261883, 'zhTW', '蘆瑟菈，風暴禿鼻鴉可以知道你的意向。專心點。', '', 56647),
(261881, 'zhTW', '如果他能違抗泰坦，那麼你也可以！', '', 56647),
(261880, 'zhTW', '貝格姆靠自己召喚來了風暴禿鼻鴉。', '', 56647),
(261878, 'zhTW', '', '我不能這麼做。泰坦他們…', 56647),
(263833, 'zhTW', '', '<哼聲>', 56647),
(261968, 'zhTW', '無縛者！', '', 56647),
(261967, 'zhTW', '那麼我，多恩諾加的議會守衛，宣布我們全體成為…', '', 56647),
(261966, 'zhTW', '誰想完成這項壯舉？', '', 56647),
(261958, 'zhTW', '就在律令被寫下的地方。', '', 56647),
(261957, 'zhTW', '我們在這裡做這件事還真是合適…一切開始的地方…', '', 56647),
(261956, 'zhTW', '', '為此，我們必須放棄律令…直到永遠。', 56647),
(261955, 'zhTW', '', '沒錯。我們必須協助我們的新盟友。', 56647),
(261954, 'zhTW', '那麼我們達成共識了？', '', 56647),
(252684, 'zhTW', '嗯？我認識你嗎？\n\n不認識？很好。我的記憶已不如以往。\n\n我是科格蘭，擔任悼念高地的管理員。那是讓無縛者進行最後關閉的地方。\n\n無縛者在最後的時刻前來此處打破泰坦的循環，並成為他們選擇的無縛者受人緬懷。\n\n除非你們和我們一樣會發生靜滯鎖定，不然我也不曉得能幫上你什麼忙。', '', 56647),
(261480, 'zhTW', '布萊恩叔叔，你有讀過這些新典籍了嗎？它們肯定是從德蘭丹的圖書館借來的。', '', 56647),
(259252, 'zhTW', '噢，你好！你是來跟布萊恩叔叔聊聊的嗎？', '', 56647),
(251198, 'zhTW', '我會待在你和布萊恩叔叔的背後。我準備好學習這裡的所有知識了！', '', 56647),
(261676, 'zhTW', '', '你好，英雄。我必須承認，能看到卡茲阿爾加讓我十分興奮。那裡有好多事值得探索！', 56647),
(275557, 'zhTW', '', '格瑞姆巴托對龍類可不是個好地方，我不太樂於喚起關於當地的記憶。\n\n但如果你是要去消滅當地的邪惡敵人並奪取他們的財富？那還真是喜聞樂見的好消息。\n\n通過時間之道的傳送門前往暮光高地，接著往西去尋找位於山腰的入口。', 56647),
(275556, 'zhTW', '', '通常你會前往波拉勒斯尋找此地的入口，順著信風市場下方的碼頭走就會到達目的地。\n\n除非你是部落的成員，那你就得透過劫掠港的安全通道過去。\n\n通過時間之道的傳送門前往提拉加德海灣，然後看北方哪座城市不把你當作殺父仇人，就能在那邊找到入口。', 56647),
(275555, 'zhTW', '', '「死靈戰地」是個有趣的地方。生前在戰地廝殺死去的人們，死後依舊在戰地殺個不停。\n\n<林多米停頓了一下來觀察你的反應>\n\n不管了，通過時間之道的傳送門前往昇靈堡然後往西南方走。入口就在勇氣神殿尚未被完全摧毀的某處廢墟那邊。', 56647),
(275554, 'zhTW', '', '特那希是個容易讓人迷路的地方，你甚至走在大路上都會迷路！\n\n通過時間之道的傳送門前往亞登曠野，然後往西方走並找出隱藏在樹根中的入口。', 56647),
(269791, 'zhTW', '「…乘著急速的羽翼。」', '', 56647),
(269790, 'zhTW', '', '「…乘著急速的羽翼。」', 56647),
(268067, 'zhTW', '你敢相信嗎，$n？想想這裡埋著多少歷史！', '', 56647),
(266394, 'zhTW', '外來者有能力勇往直前，我們也應該如此。皇帝要求我們將自己逼至超越敵人的極限。', '', 56647),
(266392, 'zhTW', '聖焰會支撐我們的，兄弟。讓異教徒去吸引寇拜斯的怒火吧。然後我們將攻擊他們毫無防備的側翼。', '', 56647),
(266390, 'zhTW', '請原諒賽巴斯坦，我的新朋友。要是沒有你的幫忙，我們也無法取得這麼多的進展。', '請原諒賽巴斯坦，我的新朋友。要是沒有你的幫忙，我們也無法取得這麼多的進展。', 56647),
(266389, 'zhTW', '你在戰鬥中的紀律非常令人佩服，我的兄弟。這個外來者最好觀察你的做法並向你學習。', '', 56647),
(261758, 'zhTW', '<安杜因看向你。>\n\n$n。你來到這底下之後一直都提供了很多幫助，就像往常一樣。你是怎麼做到的？\n\n自從暗影之境以後，我…\n\n我一直在掙扎。', '', 56647),
(261247, 'zhTW', '<安杜因看向你。>\n\n$n。你來到這底下之後一直都提供了很多幫助，就像往常一樣。你是怎麼做到的？\n\n在那些事發生之後，你為什麼還可以正眼看我…在我對你做了那些事之後？\n\n我試圖殺死你。', '', 56647),
(260534, 'zhTW', '什麼時候會發生？', '', 56647),
(260468, 'zhTW', '多恩諾加存在多久了？', '', 56647),
(260045, 'zhTW', '可以再說一次嗎？', '', 56647),
(259965, 'zhTW', '該回去工作了…還是算了。', '', 56647),
(258826, 'zhTW', '喔，你好啊！你對拾荒狩獵有興趣嗎？你當然有。\n\n我這裡有一張我在這個洞穴裡遺失的物品…我是說，各式隨機貨物的清單！誰先把所有物品都帶回來給我，就能贏得這個寶藏。\n\n我還會加碼一個能讓你游得更快來幫助你狩獵的水晶。很划算吧！', '', 56647),
(258555, 'zhTW', '', '<佛葛蕾喝了一口她的燼釀，然後才抬頭看你。>\n\n我親愛的小石子，要找到你要的液態蛋白石會需要時間。\n\n所以，趁我的鼴鼠在市場上四處努力嗅出你要找的東西時，你要是能善用你的聰明才智，我會很感激的。', 56647),
(256097, 'zhTW', '', '你好！很高興認識你！\n\n我是瑟瑞莎，瑞南新召募的阿爾加遠征隊受訓員。能來這裡讓我超興奮的。\n\n雖然發生了…你知道的。\n\n我對泰坦科技很癡迷，就瑞南所說，他和圖貝洛斯在處理那些「東西」這方面頗具聲譽。我真的很想親眼靠近看看！\n\n而且看來我有機會了！雖然代價是一整座城市的墜毀…', 56647),
(266645, 'zhTW', '布萊恩？噢，他一定跟其他探險者一起在某個地方。\n\n我們該走了，勇士。我可以聽到艾澤拉斯的傷口在尋求協助。', '', 56647),
(266491, 'zhTW', '', '你是很好的狗頭人朋友，$n。謝謝你。', 56647),
(254492, 'zhTW', '夥伴，近來可好？', '夥伴，近來可好？', 56647),
(252740, 'zhTW', '水手們，罩子放亮一點。晉升之日可不能有人來亂。', '水手們，罩子放亮一點。晉升之日可不能有人來亂。', 56647),
(251935, 'zhTW', '我們講話要快，空氣中太多毒氣了。\n\n把重踏之鞋拿去。用它來重啟壞掉的空氣淨化機、從殺死的狗頭人身上收集齒輪。取得所有齒輪，拯救供水設備。\n\n去吧。', '', 56647),
(261702, 'zhTW', '', '是時候找到真正的自我了。', 56647),
(261700, 'zhTW', '', '艾澤拉斯在成長，我們也要和她一起茁壯。', 56647),
(261701, 'zhTW', '', '我們必須要接受改變。', 56647),
(261699, 'zhTW', '', '停滯不前的傳統差點導致我們的滅亡。', 56647),
(261696, 'zhTW', '', '在麥格尼犧牲以前，土靈一直都被生與俱來的目的所束縛。', 56647),
(252793, 'zhTW', 'The Weaver bids you welcome.', '織絲者歡迎你們的到來。', 56647),
(252791, 'zhTW', 'Scurry on, little scarab!', '快跑吧，小小聖甲蟲！', 56647),
(256695, 'zhTW', '', '這很可能是為了掩飾你自己的背叛行徑！等我把他們撕碎之後，我會把你的腦袋也獻上去。', 56647),
(256694, 'zhTW', '以安蘇芮克女王之名，我會碾碎這些叛亂分子。', '', 56647),
(256691, 'zhTW', '你唯一會揭露的是你的弱點。', '', 56647),
(256690, 'zhTW', '', '謀反者在這裡！等我殺了他們，下一步就是揭曉我們之中的叛徒。', 56647),
(266867, 'zhTW', '如果你找到了什麼就帶走吧。我不會插爪的。', '如果你找到了什麼就帶走吧。我不會插爪的。', 56647),
(260896, 'zhTW', '', '暗影穿透。', 56647),
(260892, 'zhTW', '', '黏稠漩渦。', 56647),
(260891, 'zhTW', '', '黏液爆炸。', 56647),
(260875, 'zhTW', '', '掙扎是沒用的。', 56647),
(260874, 'zhTW', '', '動彈不得。', 56647),
(260838, 'zhTW', '蟲群需要進食。', '', 56647),
(260837, 'zhTW', '橫衝直撞。', '', 56647),
(260836, 'zhTW', '猛烈攻擊。', '', 56647),
(260835, 'zhTW', '急速大屠殺。', '', 56647),
(260834, 'zhTW', '勢不可擋。', '', 56647),
(260822, 'zhTW', '', '你們都會死！', 56647),
(260821, 'zhTW', '我會把你們的頭砍下來！', '', 56647),
(261912, 'zhTW', '降落，我的士兵！', '', 56647),
(254365, 'zhTW', '', '只要引起達格蘭的興趣，誰都無法阻擋他，是吧？\n\n就像我說的，泰洛科是重要採礦前哨。那裡從過去最有名的特點就是宛如運作順暢的機器，永不停歇。我和工頭柯‧布倫桂格認識很久了。但我們已經好一陣子沒有聯絡。\n\n我需要知道礦石停止生產的原因…即使至高代言者不希望我找到答案。他可能有自己派人調查，但我們得親自去看看。', 56647),
(271002, 'zhTW', 'AR-938地區地表的土靈最近經歷不少苦難。\n\n在外來者墜毀在他們的海岸後，他們的堡壘「多恩諾加」遭到奈幽蟲族攻擊。外來者和風暴飛騎順利驅逐了這些入侵者，但地心通途也嚴重毀損。\n\n在外來者的幫助下，名為無縛者(前身為石縛者)和誓語者(仍對泰坦忠心耿耿的土靈)的兩個土靈群體團結起來守住地表、剷除奈幽蟲族，並開始修復地心通途。\n\n在這些事件中，風暴飛騎蒙受極大損失，還失去了風暴守衛貝格姆。然而，地心通途通往剛達加茲和機語者的道路已經搶通。\n\n地心通途的全面修復仍在繼續進行。', '', 56647),
(270198, 'zhTW', '轉化場苦工察覺到了你的費洛蒙，並給了你一個寬敞的席位。', '', 56647),
(266936, 'zhTW', '', '我只是覺得你和圖拉揚真的很像──英勇善戰，但碰到感情卻支支吾吾的。', 56647),
(265279, 'zhTW', '但戰局就要逆轉了！', '', 56647),
(265155, 'zhTW', '', '沒有必要讓你一直活下去。', 56647),
(263196, 'zhTW', '', '自我們有記憶以來，至高代言者就一直是我們的領導者…但他不再是我們的一份子。', 56647),
(262604, 'zhTW', '', '啟動地震系統。', 56647),
(262333, 'zhTW', '我們應該能在那些小蘑菇上彈跳。', '', 56647),
(261918, 'zhTW', '', '入侵者？你看到我們從天上墜落，為了活命而戰！', 56647),
(259785, 'zhTW', '現在我們得擺脫那東西。看來是寇拜斯設下誘餌引牠來這裡的。', '', 56647),
(259762, 'zhTW', '', '向黑暗投降。', 56647),
(256027, 'zhTW', '', '你一直不管你的治療師！我怎麼能不利用這一點呢？', 56647),
(256024, 'zhTW', '我還在想怎麼讓步兵前進而不折損他呢！法林，你這樣讓騎士門戶大開？太冒險了。', '', 56647),
(255118, 'zhTW', '這座城市實在是令人嘆為觀止。阿拉希居然能在這麼短的時間內，就建造出如此規模的城市，真是太厲害了。\n\n而且想想看，這座城市在成形的時候，我們可是在對抗軍團，接著又遭遇第四次大戰，然後是…\n\n沒事。這裡真的太壯觀了。', '', 56647),
(254822, 'zhTW', '$r，好問題。我是甦醒者 - 我的工作是要進入古老地點或剛甦醒的地點，確保一切能正常運作。你把鳴響深淵想成沉眠中的巨人。我負責確保讓她受到良好的照顧，並發揮該有的功能！\n\n當我專注在儀式上的時候保護我，同時盡可能吸收機械產生的能量！如果我們的能量足夠，應該就能撐到最後…', '', 56647),
(268527, 'zhTW', '高階教士，不是只有你有這種感覺。巴雷達爾在這個狀態下的樣貌是災厄與衝突的預兆。', '', 56647),
(267619, 'zhTW', '我會把我在裡面找到的鎖甲留給你和克拉拉，小藍。', '', 56647),
(266121, 'zhTW', '<達格蘭展開了對狗頭人的蠟、蠟從何處來、蠟往何處去的冗長解釋。顯然這些都是他在鐵爐堡和卡茲阿爾加研究得來的知識，沒有實際的經驗佐證。>', '', 56647),
(265612, 'zhTW', '我聽過阿拉希的故事。身為國王…我是說，我很好奇。', '', 56647),
(265403, 'zhTW', '你到底想說什麼？', '', 56647),
(265214, 'zhTW', '太驚人了…', '', 56647),
(264962, 'zhTW', '但如果那是真的，我想親眼看看。他們可能會成為我們對抗薩拉塔斯的盟友。', '', 56647),
(264692, 'zhTW', '$n！我成功解救一些燼蜂了。', '', 56647),
(264131, 'zhTW', '你不覺得，大家似乎都很焦慮嗎？真是想不到原因。\n\n喔，對了。關於毀滅的恐怖幻象。達拉然會傳送到卡茲阿爾加的主要原因。我想起來了。', '', 56647),
(264128, 'zhTW', '擔心潛伏在卡茲阿爾加的危險嗎？別怕。畢竟，有超棒的里諾‧傑克森在你背後罩著你！', '', 56647),
(264108, 'zhTW', '然而，處理掉薩拉塔斯可不足以拯救我們的人民。讓我們走向衰敗的是安蘇芮克。', '', 56647),
(262984, 'zhTW', '先驅者悄悄地告訴過我你的到來…', '', 56647),
(262611, 'zhTW', '', '所有系統…關閉中…', 56647),
(261944, 'zhTW', '辦不到。所以我非去不可。你必須引導土靈。', '', 56647),
(261934, 'zhTW', '我只聽說過他們的英雄事蹟…那是泰坦的象徵！', '', 56647),
(261921, 'zhTW', '你要什麼不重要。', '', 56647),
(261418, 'zhTW', '', '喂！我說…我們都會被殺！', 56647),
(261128, 'zhTW', '', '高階晉升者艾塔卡特是貴族谷執政官，他應該可以拉動賦予我晉升的絲線。\n\n前提是我要能得到他的恩寵。\n\n<特錫特克有些惱怒地瞇起他所有的眼睛。>\n\n…前提是我們要先找到他。', 56647),
(260471, 'zhTW', '可以大概預估一下嗎？', '', 56647),
(260469, 'zhTW', '', '未知。文庫應該有相關情報，但就和我之前說的一樣，它目前停止運作了。', 56647),
(260334, 'zhTW', '我觀察過鑰炎中的水晶。那不是艾澤萊晶岩，但非常類似，我認為兩者應該有關聯。', '', 56647),
(260299, 'zhTW', '', '每個人都有類似的遭遇。我還記得我有一次發現一個山洞…', 56647),
(260176, 'zhTW', '當然！你的記憶應該跟我的一樣。在幾千年後，有些部分已經稍微模糊…', '', 56647),
(260092, 'zhTW', '', '我會等賞金變高再來領賞。在那之前…別死了。', 56647),
(260028, 'zhTW', '向前邁進。迎接下一個冒險。', '', 56647),
(260019, 'zhTW', '', '現在你又…變回來了…覺得如何？', 56647),
(259046, 'zhTW', '別遊蕩到黑暗之中。', '別遊蕩到黑暗之中。', 56647),
(258553, 'zhTW', '<在你檢視紙條時，小織蛛將其舉起。>\n\n幾個失敗的實驗品在深淵堡胡作非為。在牠們逃離之前將牠們解決掉。\n\n這片區域藏著能阻止牠們的費洛蒙炸彈。但首先，你需要隱藏你的氣味。我給了你一些可以達到這個效果的費洛蒙。\n\n把裝置取回，然後將這些可憐的生物徹底根除。\n\n-織絲者', '', 56647),
(258479, 'zhTW', '耶！快跑！', '耶！快跑！', 56647),
(258194, 'zhTW', '全員！立刻回到崗位上！', '', 56647),
(258037, 'zhTW', '別誤會我的意思。我們得馬上前往卡茲阿爾加。唉，但我還是很疲憊。\n\n艾澤拉斯有時還真是咄咄逼人。', '', 56647),
(258035, 'zhTW', '我們的命運就在卡茲阿爾加等著我們。我們究竟會有什麼發現？我是指除了連天烽火之外。', '', 56647),
(258010, 'zhTW', '爺爺經歷過比這更慘的事。他很快就會醒來的。\n\n他必須醒來…', '', 56647),
(258006, 'zhTW', '我不認為我們要因為這個結果而怪罪艾澤拉斯。麥格尼一定了解在心中充滿芥蒂的情況下與她連結的風險。\n\n現在我們只能期望，他能順利聽到她想傳達的訊息。', '', 56647),
(257697, 'zhTW', '牠們真的傳送走了？終於啊，大突破！', '牠們真的傳送走了？終於啊，大突破！', 56647),
(257511, 'zhTW', '', '奧巴里格，你在哪裡？我們需要你…', 56647),
(255510, 'zhTW', '', '我們不確定下面有什麼！援軍已經在路上了，我們可以等到…', 56647),
(254629, 'zhTW', '', '這道…暗影！太強大了…！', 56647),
(253162, 'zhTW', '沒辦法再邀請其他人了。', '', 56647),
(253151, 'zhTW', '魔怒不足。', '', 56647),
(252126, 'zhTW', '我很慶幸現在爺爺沒事了。我們相處的時間不長，一想到他…\n\n但現在沒事了！他看起來已經完全康復了。', '', 56647),
(268542, 'zhTW', '', '我們取得了記憶寶石。然而，我們必須繼續前進，把這個地方目前遭遇的奈幽蟲族威脅除掉。然而，蛛網的存在讓人很受不了…\n\n我會改良一下裝置，讓它可以摧毀蛛網。用它來開出一條往前的路吧。', 56647),
(268257, 'zhTW', '那都是火爆動作太慢的錯。', '', 56647),
(268256, 'zhTW', '因為你在坦克準備好之前就衝了，牠們才會把你的長袍用髒。', '', 56647),
(268043, 'zhTW', '', '姊妹？你還好嗎？', 56647),
(267317, 'zhTW', '', '<塔菈之前的羞澀已然消失，她現在興高采烈地把湯匙像劍一樣揮舞。>\n\n等我長大之後，我要成為土靈！媽媽說他們全都是石頭，體內還有寶石。\n\n我以前有試過吃寶石，但那還挺難的。我決定我要慢慢來，先把寶石壓碎，這樣就更容易吞了！', 56647),
(265656, 'zhTW', '', '這…這是一位騎士在踏上遠征之前，請我幫她做的。', 56647),
(265652, 'zhTW', '這刻像雕塑的是烈焰之爪民謠。那是一隻無畏地衝入燃燒船隻，拯救牠的騎手的傳奇戰貓。', '', 56647),
(265609, 'zhTW', '', '很高興見到你，勇士。這傢伙從洞裡爬出來之後，我一直在追蹤牠。', 56647),
(265317, 'zhTW', '哇，她說我棒極了？這些話總是能讓我「燈」光煥發，抱歉講了雙關笑話。', '', 56647),
(264561, 'zhTW', '', '那頭怪物逃回他們的女王那裡了。她絕對會去散布你令人敬畏的英勇事蹟。', 56647),
(264549, 'zhTW', '', '還好我的女兒跟她的孩子都沒事。你不只削弱了指揮官，還把我家打掃乾淨。謝謝你。', 56647),
(262945, 'zhTW', '我們跨越了風暴肆虐的海域，我從沒看過這麼高的浪和這麼強的風！有好幾次我都以為我們的船要被暴風雨擊沉了！', '我們跨越了風暴肆虐的海域，我從沒看過這麼高的浪和這麼強的風！有好幾次我都以為我們的船要被暴風雨擊沉了！', 56647),
(262812, 'zhTW', '進屋！', '進屋！', 56647),
(262440, 'zhTW', '是時候放出我的蜜蜂了！', '', 56647),
(262197, 'zhTW', '牠們或許不是最令人食指大動的美食，但只需抓一點，把牠們關在罐子裡，牠們就會是很方便的光源。\n\n之前有一次，當我在雜草堆裡拾荒時，有一隻好大的火花蟲被我罐子的光吸引過來！牠在我後面跟了一段時間，幾乎像是隻寵物了。真是溫馴的生物，只想在旁邊飛來飛去，放出牠那繽紛的光芒。', '', 56647),
(261385, 'zhTW', '土靈人偶停滯在一個絕望的狀態，其細節做工並不遜色於你在上面所見識過的那個製造真正土靈的工藝。\n\n這個作品的石頭材質看起來與真正的土靈相同。', '土靈人偶停滯在一個絕望的狀態，其細節做工並不遜色於你在上面所見識過的那個製造真正土靈的工藝。\n\n這個作品的石頭材質看起來與真正的土靈相同。', 56647),
(261292, 'zhTW', '別站在那發呆啊！', '', 56647),
(260817, 'zhTW', '歡迎，$r。\n\n很久以前，議會守衛梅里斯任命我為多恩諾加的裝飾者。\n\n我的職責就是維護城市的美學和諧。隨著每個週期的流逝，我孜孜不倦地將時尚和美感融入多恩諾加街道的結構中，為其注入與我們尊貴傳統相符的細緻優雅和實用魅力。\n\n身為肩負重任的裝飾者，我發誓會維護梅里斯的遺產，並確保多恩諾加在未來的週期中仍然會是美和奇觀的信標。\n\n有什麼可以為你效勞的嗎？', '', 56647),
(259422, 'zhTW', '', '謝謝你！把這雙靴子拿去，讓寇拜斯知道他們掠奪我們的村莊時，我們是不會袖手旁觀的。', 56647),
(259414, 'zhTW', '', '這群寇拜斯掠奪村莊並奪走聖物之後，我就追著他們到陷坑去了。\n\n不幸的是，我是個發明家，而不是鬥士。是飆升的腎上腺素才讓我走到這一步。不過，我有一樣發明可以讓你派上用場。\n\n這雙輕巧的靴子就交給你了。其中的魔法可以讓你彈射到高空中，然後出奇不意地向下墜擊那些敵人。這雙靴子能助你擊敗下方的寇拜斯。', 56647),
(257935, 'zhTW', '', '奈幽蟲族在用斯卡汀來追捕機語者。\n\n計畫如下：把這個裝置拿去。它會引誘斯卡汀到另一個地點去。利用它來拯救其他機語者。\n\n這算是個…實驗性的計畫，並不適合我。我會待在這裡。', 56647),
(256314, 'zhTW', '', '帝王山貓非常的執拗。除了我，火花不讓任何人騎。牠心情不好的時候，就算只剩最後一小段路，我可能得自己用走的才能把貨送達。\n\n但只要火花一跑起來，除了飛船以外，就沒有比牠更快的了。牠是我最需要的夥伴，讓我在路上毫無後顧之憂。', 56647),
(255997, 'zhTW', '聽起來參訪帝國的旅程會相當有趣。', '', 56647),
(255898, 'zhTW', '<琪亞拉邊煮飯邊哼著歌，面帶微笑。鍋子裡散發出洋蔥和大蒜的味道。>', '<琪亞拉邊煮飯邊哼著歌，面帶微笑。鍋子裡散發出洋蔥和大蒜的味道。>', 56647),
(253535, 'zhTW', '', '灰燼啊，她消失了。無論稍早是誰救了我們，她肯定不是奈幽蟲族的夥伴。把她找出來。我會救大家出去。', 56647),
(248952, 'zhTW', '看來我們要跳了！', '', 56647);
