(2640, 'zhTW', '布萊恩‧銅鬚', '可靠的探究夥伴', 56647),
(2600, 'zhTW', '斷裂絲線', '安蘇芮克女王的混亂統治下不是沒有批評者的。斷裂絲線在幕後巧妙且靜默地執行任務，試圖從內部揭開安蘇芮克女王鐵血統治的面紗。', 56647),
(2596, 'zhTW', '斷裂絲線(典範)', '安蘇芮克女王的混亂統治下不是沒有批評者的。斷裂絲線在幕後巧妙且靜默地執行任務，試圖從內部揭開安蘇芮克女王鐵血統治的面紗。', 56647),
(2606, 'zhTW', '貴族谷', '影響蛛絲城貴族谷的生物行為。', 56647),
(2649, 'zhTW', '將軍(典範)', '阿努巴札爾曾是阿茲-卡罕特裡最為知名的軍事領袖，如今卻被安蘇芮克最為寵信的一名晉升者取代。令他完全無法接受。', 56647),
(2648, 'zhTW', '織絲者(典範)', '曾為皇家織絲者的寡婦阿拉克娜依現在以她縝密的眼光關照著她過去的家園。有了能由她自由運用的小織蛛與間諜網路，沒有什麼情報能躲過她的注意。', 56647),
(2647, 'zhTW', '輔臣(典範)', '執行官尼茲瑞克是安蘇芮克女王最忠誠的諫官，待在這個職位上的他每天都得提心吊膽。所幸，安蘇芮克還尚未發現他窮極了一生的力量，試圖終結她的統治。', 56647),
(2607, 'zhTW', '輔臣', '執行官尼茲瑞克是安蘇芮克女王最忠誠的諫官，待在這個職位上的他每天都得提心吊膽。所幸，安蘇芮克還尚未發現他窮極了一生的力量，試圖終結她的統治。', 56647),
(2605, 'zhTW', '將軍', '阿努巴札爾曾是阿茲-卡罕特裡最為知名的軍事領袖，如今卻被安蘇芮克最為寵信的一名晉升者取代。令他完全無法接受。', 56647),
(2601, 'zhTW', '織絲者', '曾為皇家織絲者的寡婦阿拉克娜依現在以她縝密的眼光關照著她過去的家園。有了能由她自由運用的小織蛛與間諜網路，沒有什麼情報能躲過她的注意。', 56647);
