(224838, 'zhTW', '最微小的空無石裂片，散發著空洞的脈動光環。它對任何工藝製作都不是特別有用，但研究它可以讓你更了解阿爾加的礦石和礦物。', '', '', '', '空無裂片', 56647),
(224835, 'zhTW', '即使玫瑰被拔除，樹根依舊會生長。沒有任何實際用途，但非常耐人尋味。', '', '', '', '暗叢樹根', 56647),
(224782, 'zhTW', '小而極度鋒利的生物利爪。雖然其大小不足以用作實際用途，卻能讓人提起興趣進行研究。', '', '', '', '銳利的爪子', 56647),
(224781, 'zhTW', '一小簇帶有深紫色調的毛皮。雖沒有太多的傳統用途，但如此迷人且稀有的樣品並不多見。', '', '', '', '深淵毛皮', 56647),
