(224056, 'zhTW', '一本駭人典籍，探討如何有效肢解屍體來製造有用的皮革製品。其中包括利用聯盟和部落種族軀殼的方式。對不拘小節的製皮師會有用。', '', '', '', '剩餘軀殼的用途(將它們拆開之後)', 56647),
