(224054, 'zhTW', '一本剛印製的小冊子，描述共鳴水晶在奈幽寶石工藝中的應用理論。對珠寶設計師會有用。', '', '', '', '地表居民的新興水晶', 56647),
(224053, 'zhTW', '副標題為「安-卡罕特殞落的教訓」，這本典籍考究了擾亂和偏轉巫妖王及其僕人符文之力的潛在方法。對雕銘師可能會有用。', '', '', '', '防禦敵對符文的八種觀點', 56647),
(224052, 'zhTW', '出乎意料富含見解的書籍，可幫助奈幽孩童理解工程學的概念。對工程師可能還是會有用。', '', '', '', '時鐘、齒輪、鏈輪和腳', 56647),
(224050, 'zhTW', '一個詳細講述對個人蛛網附魔能帶來何種價值的促銷包。對附魔師可能會有用。', '', '', '', '蛛網火花：華麗而強大', 56647),
(224038, 'zhTW', '一本破舊的小冊子，指導奈幽鐵匠如何適應用更平凡的材料進行作業，而不是用他們過去使用的薩鋼。對鐵匠可能會有用。', '', '', '', '捨棄薩鋼的鍛造術', 56647),
(224036, 'zhTW', '一本奈幽蟲族的書籍，紀載了劇場蛛網編織的悠久歷史。裁縫師可能會學到一些有用的經驗。', '', '', '', '層層蛛網的幕後秘辛！', 56647),
(224024, 'zhTW', '關於將某人的肉體永久轉化所帶來的煉金副作用的概論。對鍊金師可能會有用。', '', '', '', '肉體轉化理論，第8章', 56647),
(224023, 'zhTW', '一本描述如何使用卡茲阿爾加和北裂境的稀有草藥完美保存屍體，好保留其風味的小書籍。對草藥師可能會有用。', '', '', '', '草藥防腐技藝', 56647),
(224007, 'zhTW', '一本詳細的指南，記載了如何利用蜘蛛吞噬獵物之後的殘骸。對剝皮師稍微會有用，對所有人來說都很噁心。', '', '', '', '剩餘軀殼的用途(如何將它們拆開)', 56647),
