(226264, 'zhTW', '每週寶箱含有裝備升級材料、金幣及其他物品。\n\n你每週獲得的前兩個每週寶箱含有一件精兵裝備。你每週獲得的前四個每週寶箱含有1把復原的寶庫鑰匙。', '', '', '', '聖輝寶箱', 56647),
