INSERT INTO `journal_encounter_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2581, 'zhTW', '阿努比卡杰', '阿努比卡杰是安蘇芮克女王最傑出的戰術大師之一。他是位一絲不苟的謀略者，擅長用有創意的方式利用本土資源並以此聞名。他的士兵忠誠的程度可說十分狂熱。', 56647),
(2654, 'zhTW', '喬巴‧紅鉤', '整個庫爾提拉斯都陷入喬巴‧紅鉤帶來的恐懼中。在鐵潮部隊的撐腰下，喬巴得以在波拉勒斯橫行無阻，滿足於在市街上四處蔓延的混沌。', 56647),
(2590, 'zhTW', '大師級機械工', '大師級機械工熱衷於在夙負盛名的工作場進行複雜的工程。從所有人有記憶開始，布洛克和朵利塔就一直合作無間。實際上，布洛克的生產力正在下滑，但兩人都得到授權，能夠使用直接且有效的暴力手段來保衛他們的工作場。', 56647),
(2582, 'zhTW', '虛無代言者埃里奇', '埃里奇遭到罷黜，他的權力也隨之被剝奪！在如此困窘的情況下，他逃向石庫最深處的聖所。然而他為了實現陰謀，竟屈服於變異，利用故障神器的虛無能量腐化了自己的石頭身體！現在他的理智已經被神秘的啟示所粉碎。', 56647),
(2579, 'zhTW', '斯卡莫拉克', '至高代言者耗費數年的時間，試圖讓甦醒機械恢復運作。一次失敗的嘗試造就了一種全新的恐怖事物：結合了斯卡汀腐化的魔像。水晶增強了其元素配置。雖然它幾乎沒有表達出它那異樣的思維，但它對所有造物抱持的仇恨是不可否認的。', 56647),
(2572, 'zhTW', 'E.D.N.A.', '防禦系統啟動！土靈防禦與消滅自動機開始行動。非正式命名：E.D.N.A。這尊魔像具有處理任何潛在入侵者的預防措施。殺死斯卡汀是它的首要指令，但任何未經授權的入侵者都足以讓它採取致命的應對手段。', 56647),
(2593, 'zhTW', '菈夏南', '菈夏南來自阿茲-卡罕特的深淵，這頭飛行怪物是安蘇芮克女王的秘密武器，若是她的軍隊沒能征服米雷達爾，她就要用菈夏南來摧毀阿拉希。', 56647);
