(28978, 'zhTW', '第1區', '幼蛛扭曲者歐維納斯對玩家施以|cFF2959D3|Hspell:442526|h[實驗療法]|h|r，在效果結束後，使附近的卵孵化，釋放其中的恐怖事物。\n\n能量達到100點時，幼蛛扭曲者歐維納斯會|cFF2959D3|Hspell:442430|h[吞食黑血]|h|r，實力隨即增強，並使場地逐漸充滿|cFF2959D3|Hspell:442802|h[血紅溢流]|h|r。', 56647),
(28901, 'zhTW', '治療者', '$bullet;一波波|cFF2959D3|Hspell:439789|h[滾湧強酸]|h|r朝指示方向移動，將任何|cFF2959D3|Hspell:439780|h[黏網]|h|r腐蝕成|cFF2959D3|Hspell:439776|h[酸液之池]|h|r。\n$[14,17$bullet;|cFF2959D3|Hspell:434089|h[絲囊之絲]|h|r斷裂時會對全隊造成傷害。$]\n$[15$bullet;|cFF2959D3|Hspell:434089|h[絲囊之絲]|h|r會影響目標玩家附近的所有其他玩家，並在斷裂時對全隊造成傷害。$]\n$[16$bullet;|cFF2959D3|Hspell:434089|h[絲囊之絲]|h|r斷裂時會形成|cFF2959D3|Hspell:460789|h[黏性絲線]|h|r。$]\n$[14,17$bullet;|cFF2959D3|Hspell:455287|h來自[感染的幼蛛]|h|r的|cFF2959D3|Hspell:439815|h[寄生撕咬]|h|r會造成大量傷害。$]\n$[15,16$bullet;|cFF2959D3|Hspell:439815|h[感染的幼蛛]|h|r在撞擊時會對目標玩家周圍造成高傷害。$]', 56647),
(28181, 'zhTW', '傷害輸出', '$bullet;|cFF2959D3|Hspell:426860|h[黑暗之球]|h|r的移動距離越長，最終爆炸造成的傷害越低。\n$bullet;|cFF2959D3|Hspell:427001|h[恐嚇猛擊]|h|r會對主要目標附近的其他玩家造成大量傷害，並使其陷入恐懼。', 56647),
(28179, 'zhTW', '治療者', '$bullet;|cFF2959D3|Hspell:426860|h[黑暗之球]|h|r的移動距離越長，最終爆炸造成的傷害越低。\n$bullet;|cFF2959D3|Hspell:426787|h[暗影凋零]|h|r會對所有玩家造成大量傷害。', 56647),
(28429, 'zhTW', '坦克', '$bullet;|cFF2959D3|Hspell:440134|h[蜂蜜醃漬]|h|r會在效果結束後從目標玩家身上滴落，形成一灘灘燃燒蜂蜜，造成火焰傷害。\n$bullet;在|cFF2959D3|Hspell:438025|h[點心時間]|h|r，競技場上的桶子會週期性地吸引貪婪燼蜂。', 56647),
(28711, 'zhTW', '治療者', '$bullet;|cFF2959D3|Hspell:458272|h[寰宇幻影]|h|r作用期間會對所有玩家造成輕度傷害。\n\n$bullet;被摧毀時，|cFF2959D3|Hspell:458272|h[寰宇幻影]|h|r會對所有玩家施加|cFF2959D3|Hspell:459273|h[寰宇裂片]|h|r。\n\n$bullet; |cFF2959D3|Hspell:433475|h[相位之刃]|h|r會對所有被擊中的玩家造成大量持續性傷害，並降低受到的治療效果。', 56647),
(30381, 'zhTW', '傷害輸出', '$bullet;如果未被擊敗，虔誠的信徒會施放|cFF2959D3|Hspell:448458|h[星宙末日]|h|r。\n$bullet;如果幽影幼蛛觸及安蘇芮克，會造成致命傷害。\n$bullet;如果|cFF2959D3|Hspell:445422|h[起沫暴食]|h|r吸收|cFF2959D3|Hspell:445152|h[侍僧精華]|h|r，就會觸發|cFF2959D3|Hspell:445877|h[口沫蒸氣]|h|r。\n$bullet;如果|cFF2959D3|Hspell:437417|h[毒液新星]|h|r引爆|cFF2959D3|Hspell:438846|h[反應泡沫]|h|r，就會觸發|cFF2959D3|Hspell:441556|h[反應蒸氣]|h|r。', 56647),
(30002, 'zhTW', '傷害輸出', '$bullet;如果未被擊敗，虔誠的信徒會施放|cFF2959D3|Hspell:448458|h[星宙末日]|h|r。\n$bullet;如果幽影幼蛛觸及安蘇芮克，會造成致命傷害。\n$bullet;如果|cFF2959D3|Hspell:445422|h[起沫暴食]|h|r吸收|cFF2959D3|Hspell:444829|h[女王的召喚]|h|r，就會觸發|cFF2959D3|Hspell:445877|h[口沫蒸氣]|h|r。\n$bullet;如果|cFF2959D3|Hspell:437417|h[毒液新星]|h|r引爆|cFF2959D3|Hspell:438846|h[反應泡沫]|h|r，就會觸發|cFF2959D3|Hspell:441556|h[反應蒸氣]|h|r。', 56647),
