(30383, 'zhTW', '第15區', '$[!8,23\n\n在傳奇難度下，燃焰碎塊會持續$430000d。$]', 56647),
(29546, 'zhTW', '德拉卡‧燃影者', '德拉卡‧燃影者會獨自與玩家戰鬥，直到他即將被擊敗為止。此時他會召喚瓦莉歐娜加入戰鬥。然後德拉卡會在瓦莉歐娜的背上，繼續與玩家戰鬥。', 56647),
(28981, 'zhTW', '治療者', '$bullet;|cFF2959D3|Hspell:442526|h[實驗療法]|h|r會孵化附近的卵，放出其中培育的可怕實驗體。\n$bullet;幼蛛扭曲者歐維納斯受到的|cFF2959D3|Hspell:450362|h[不穩定灌注]|h|r效果越多，造成的暗影傷害和治療吸收效果越高。\n$bullet;|cFF2959D3|Hspell:441362|h[爆炸性混合物]|h|r被移除時，會根據目標損失的生命力對所有玩家造成傷害。', 56647),
