(28970, 'zhTW', '傷害輸出', '$bullet;|cFF2959D3|Hspell:444363|h[悚然嘔吐]|h|r會將血縛之懼面前的玩家送入|cFF2959D3|Hspell:462306|h[非表象之境]|h|r。\n$bullet;被遺忘的先驅者在被打敗前會持續使用|cFF2959D3|Hspell:445174|h[恐懼現身]|h|r。\n$bullet;|cFF2959D3|Hspell:443042|h[虛空之握]|h|r隨機在玩家底下形成。', 56647),
