(28902, 'zhTW', '坦克', '$bullet;一波波|cFF2959D3|Hspell:439789|h[滾湧強酸]|h|r朝指示方向移動，將任何|cFF2959D3|Hspell:439780|h[黏網]|h|r腐蝕成|cFF2959D3|Hspell:439776|h[酸液之池]|h|r。\n$bullet;|cFF2959D3|Hspell:439815|h[感染的幼蛛]|h|r對原本的目標施放|cFF2959D3|Hspell:455287|h[寄生撕咬]|h|r後，會開始四處移動。\n$bullet;來自|cFF2959D3|Hspell:444687|h[野蠻突襲]|h|r的未減輕傷害會堆疊為|cFF2959D3|Hspell:458067|h[蠻荒致傷]|h|r。', 56647),
(28893, 'zhTW', '概覽', '絲綢宮廷的領主捉對廝殺，以贏得女王的青睞，輪流以|cFF2959D3|Hspell:439992|h[織網炸彈]|h|r和|cFF2959D3|Hspell:440158|h[無畏衝鋒]|h|r襲擊敵人。\n\n虛無能量達到100點時，塔卡茲會晉升成虛無形態，並開始|cFF2959D3|Hspell:450980|h[粉碎存在]|h|r。\n\n在重新加入戰鬥後，阿努巴拉許會開始召喚|cFF2959D3|Hspell:438677|h[刺螫蟲群]|h|r，而塔卡茲則會同時施放|cFF2959D3|Hspell:438355|h[災變無序]|h|r。\n\n怒氣達到100點時，阿努巴拉許會進入怒靈狂吼，並釋放|cFF2959D3|Hspell:451277|h[尖刺風暴]|h|r。\n\n在兩名宮廷成員火力全開時，阿努巴拉許會以|cFF2959D3|Hspell:440158|h[無畏衝鋒]|h|r襲捲整個場地，而塔卡茲則會施放災變無序。', 56647),
(28833, 'zhTW', '概覽', '烏格拉斯試圖以|cFF2959D3|Hspell:434799|h[肉食比賽]|h|r吞噬玩家，並在競技場上放置數個|cFF2959D3|Hspell:439502|h[潛獵者絲網]|h|r。\n\n能量降至0點時，烏格拉斯會餓到陷入瘋狂，並以|cFF2959D3|Hspell:436217|h[滅殺衝鋒]|h|r攻擊玩家。然後烏格拉斯會開始進食，釋放|cFF2959D3|Hspell:458074|h[飢饞嚎叫]|h|r，直到能量回滿為止。', 56647),
