(28438, 'zhTW', '治療者', '$bullet;|cFF2959D3|Hspell:435622|h[歡呼吧]|h|r會引爆所有剩餘的燼釀蜜酒炸彈，並對所有玩家造成大量物理傷害。\n$bullet;每個引爆的燼釀蜜酒炸彈都會製造|cFF2959D3|Hspell:435789|h[燼燃創傷]|h|r，在短時間內對所有玩家造成大量火焰傷害。\n$bullet;|cFF2959D3|Hspell:436640|h[燃燒彈射]|h|r會對受影響的玩家造成大量持續性火焰傷害。', 56647),
(28437, 'zhTW', '傷害輸出', '$bullet;|cFF2959D3|Hspell:435622|h[歡呼吧]|h|r會引爆剩餘的所有燼釀蜜酒炸彈。\n$bullet;每個引爆的燼釀蜜酒炸彈都會製造|cFF2959D3|Hspell:435789|h[燼燃創傷]|h|r，在短時間內對所有玩家造成大量火焰傷害。\n$bullet;|cFF2959D3|Hspell:436640|h[燃燒彈射]|h|r會彈跳至附近玩家和燼釀蜜酒炸彈。', 56647),
