(28132, 'zhTW', '概覽', '代言者影冠因黑夜教團未能成功奪下破曉者號而被激怒，隨即施展強大的暗影魔法加入戰局。\n\n在剩餘生命力為50%與1%時，影冠會釋放|cFF2959D3|Hspell:451026|h[黑暗降臨]|h|r，試圖消滅留在破曉者號上的所有玩家。', 56647),
