(30004, 'zhTW', '坦克', '$bullet;|cFF2959D3|Hspell:436799|h[液化]|h|r的玩家極易受到|cFF2959D3|Hspell:437093|h[噬食]|h|r的傷害。\n$bullet;|cFF2959D3|Hspell:443325|h[寄生]|h|r效果結束後，會對大範圍內的盟友造成大量傷害。\n$bullet;|cFF2959D3|Hspell:443336|h[暴食]|h|r每一擊造成的傷害會越來越高。\n$bullet;|cFF2959D3|Hspell:437417|h[毒液新星]|h|r在觸及|cFF2959D3|Hspell:438846|h[反應泡沫]|h|r時，會使其變得不穩定。', 56647),
