(22904, 'zhTW', '概況說明', '耐祖奧的殘骸週期性地召喚折磨之球，對所有玩家造成傷害，直到被消滅並丟下平台為止。\n\n在生命力剩餘80%、60%和30%時，包覆耐祖奧的殘骸的一件護甲會粉碎，使|cFF2959D3|Hspell:350671|h[忿恨光環]|h|r的強度提高。', 56647),
