(30000, 'zhTW', '坦克', '$bullet;|cFF2959D3|Hspell:436799|h[液化]|h|r的玩家極易受到|cFF2959D3|Hspell:437093|h[噬食]|h|r的傷害。\n$bullet;|cFF2959D3|Hspell:437093|h[噬食]|h|r會吸收大量治療效果。\n$bullet;|cFF2959D3|Hspell:443325|h[寄生]|h|r會製造幽影幼蛛，如果幼蛛觸及安蘇芮克，會造成致命傷害。\n$bullet;|cFF2959D3|Hspell:443336|h[暴食]|h|r會對所有玩家造成多次大量傷害，可透過減傷效果度過。', 56647),
(29998, 'zhTW', '傷害輸出', '$bullet;如果未被擊敗，虔誠的信徒會施放|cFF2959D3|Hspell:448458|h[星宙末日]|h|r。\n$bullet;如果|cFF2959D3|Hspell:445422|h[起沫暴食]|h|r吸收|cFF2959D3|Hspell:444829|h[女王的召喚]|h|r，就會觸發|cFF2959D3|Hspell:445877|h[口沫蒸氣]|h|r。\n$bullet;|cFF2959D3|Hspell:437417|h[毒液新星]|h|r會造成大量傷害，除非透過|cFF2959D3|Hspell:438846|h[反應泡沫]|h|r躲避。\n$bullet;|cFF2959D3|Hspell:445422|h[起沫暴食]|h|r會造成大量傷害，除非透過|cFF2959D3|Hspell:443915|h[深淵導體]|h|r躲避。', 56647),
(29997, 'zhTW', '概覽', '$[14,17戰鬥開始時，安蘇芮克會射出|cFF2959D3|Hspell:438846|h[反應泡沫]|h|r，然後釋放|cFF2959D3|Hspell:437417|h[毒液新星]|h|r。最終，安蘇芮克會以|cFF2959D3|Hspell:447076|h[掠擊]|h|r試圖吞食被弱化的敵人。\n\n在玩家打破安蘇芮克的蛛網護盾後，她開始向上回到私人的房間，並呼叫救兵。他們準備釋放|cFF2959D3|Hspell:448458|h[星宙末日]|h|r，安蘇芮克則從遠處攻擊玩家。\n\n當玩家突破安蘇芮克的私人房間時，她會停止施放|cFF2959D3|Hspell:449940|h[強酸末日]|h|r，並開始施放|cFF2959D3|Hspell:449986|h[無光交流]|h|r。安蘇芮克利用更強大的宇宙之力，試圖以|cFF2959D3|Hspell:445422|h[起沫暴食]|h|r吞噬|cFF2959D3|Hspell:444829|h[女王的召喚]|h|r。$]$[15,16戰鬥開始時，安蘇芮克會射出|cFF2959D3|Hspell:438846|h[反應泡沫]|h|r，然後釋放|cFF2959D3|Hspell:437417|h[毒液新星]|h|r。最終，安蘇芮克會以|cFF2959D3|Hspell:447076|h[掠擊]|h|r試圖吞食被弱化的敵人。\n\n在玩家打破安蘇芮克的蛛網護盾後，她開始向上回到私人的房間，並呼叫救兵。他們準備釋放|cFF2959D3|Hspell:448458|h[星宙末日]|h|r，安蘇芮克則從遠處攻擊玩家。\n\n當玩家突破安蘇芮克的私人房間時，她會停止施放|cFF2959D3|Hspell:449940|h[強酸末日]|h|r，並開始施放|cFF2959D3|Hspell:449986|h[無光交流]|h|r。安蘇芮克利用更強大的宇宙之力，試圖以|cFF2959D3|Hspell:445422|h[起沫暴食]|h|r吞噬|cFF2959D3|Hspell:445152|h[侍僧精華]|h|r。$]', 56647),
(29707, 'zhTW', '虛無能量體', '風暴復仇會使巨怪的一部分落在場上。這些能量體隨即在$428269D內將自己重塑成虛無石覺醒者。', 56647),
(28834, 'zhTW', '傷害輸出', '$bullet; |cFF2959D3|Hspell:439502|h[潛獵者絲網]|h|r接觸到玩家和附近盟友時，會將其困在|cFF2959D3|Hspell:455831|h[硬化之網]|h|r中。\n$bullet;飢餓之子會持續對一名玩家|cFF2959D3|Hspell:439037|h[開膛破腹]|h|r。', 56647),
(27369, 'zhTW', '治療者', '$bullet;沒有|cFF2959D3|Hspell:426866|h[燭光]|h|r的玩家會受到|cFF2959D3|Hspell:422806|h[窒息之影]|h|r的弱化效果。\n$bullet;|cFF2959D3|Hspell:427100|h[陰晦爪擊]|h|r和|cFF2959D3|Hspell:427011|h[暗影衝擊]|h|r擊中燭光時，都會對其造成傷害。', 56647),
(27367, 'zhTW', '坦克', '$bullet;沒有|cFF2959D3|Hspell:426866|h[燭光]|h|r的玩家會受到|cFF2959D3|Hspell:422806|h[窒息之影]|h|r的弱化效果。\n$bullet;|cFF2959D3|Hspell:427100|h[陰晦爪擊]|h|r和|cFF2959D3|Hspell:427011|h[暗影衝擊]|h|r擊中燭光時，都會對其造成傷害。', 56647);
INSERT INTO `journal_instance_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(1271, 'zhTW', '『回音之城』厄拉卡拉', '蛛絲城的正下方是『回音之城』厄拉卡拉，也是過去廢棄城市的廢墟。安蘇芮克的勢力在那裡採集了足量的致命材料，以便在必要時讓整個奈幽蟲族子民都能獲得晉升…無論他們個人的意願為何。', 56647),
(1278, 'zhTW', '卡茲阿爾加', '卡茲阿爾加的地底近期遭逢了非同小可的劇變。在地心通途遭受破壞、奈幽蟲族蓄勢待發的當下，其他威脅也相繼現身。『休眠的保護者』寇達為了保衛多恩島從長眠中甦醒。在鳴響深淵，恐懼聚合體正靜靜地等待。聖落之地的水域因『無底深海怪物』舒萊而動盪起伏。在阿茲-卡罕特的深淵，深行者『破碎山脈』歐爾塔早已受到黑血的扭曲。', 56647);
INSERT INTO `keystone_affix_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(9, 'zhTW', '暴君', '首領的生命力提高25%。首領與其爪牙所造成的傷害提高15%。', 56647),
(145, 'zhTW', '無畏', '沒有法力的非首領敵人造成的攻擊會無視20%護甲值，但自身護甲值降低30%，且受到的秘法傷害提高10%。', 56647),
(144, 'zhTW', '荊棘', '沒有法力的非首領敵人受到攻擊時，會對攻擊者造成物理傷害，但受到的神聖與暗影傷害提高10%。', 56647),
(133, 'zhTW', '專注', '帶有法力的非首領敵人，加速提高30%，但受到的冰霜與火焰傷害提高10%。', 56647);
