(776, 'zhTW', '迅捷鬼靈萊拉克', '|cFFFFD200經典|r', '即便亡者，有時還是需要搭個便車。', 56647),
(2188, 'zhTW', '『深淵傳奇』卡哈', '|cFFFFD200成就：|r大賽衝刺|n|cFFFFD200類別：|r釣魚', '', 56647),
(2218, 'zhTW', '百鍊鬥士魔蝠', '|cFFFFD200成就：|r鬥士：地心之戰第1賽季|n|cFFFFD200類別：|rPvP', '牠們從戰場上的洞穴中甦醒過來，身上的強大防護也讓牠們隨時都能作戰。', 56647),
(2159, 'zhTW', '機械防禦單位1-11', '|cFFFFD200寶藏：|r甦醒貯藏箱|n|cFFFFD200區域：|r鳴響深淵', '其中一款用來保護機械的機甲裝。在多年的忠心服務之後，它已經不再適合戰鬥。不過，用它來當載具看起來還是很厲害。', 56647),
(2209, 'zhTW', '赤紅泥鼻鼴鼠', '|cFFFFD200商人：|r蠟販史奇克|n|cFFFFD200區域：|r鳴響深淵|n|cFFFFD200花費：|r8125|Hcurrency:2815|h|TInterface\\ICONS\\SPELL_AZERITE_ESSENCE14.BLP:0|t|h', '深淵集會的狗頭人經常將泥鼻鼴鼠作為坐騎，現在他們決定讓你擁有一隻他們最忠心的泥鼻鼴鼠。', 56647);
