(32, 'zhTW', '天啟騎士', '天啟騎士召來傳奇四騎士的力量。他們可以召喚騎士來助戰，同時還能汲取死亡、飢寒與疾病的力量。', 56647),
(64, 'zhTW', '天尊引導者', '天尊引導者全心全意奉獻自己的一生來體現聖獸天尊的智慧，並駕馭他們的力量。引導者大師們能在頃刻之間引導出所有天尊的力量。', 56647),
(39, 'zhTW', '日怒', '透過擁抱秘法烈焰，日怒法師能強化最為致命的法術，甚至還能召喚魔焰鳳凰來助戰。', 56647),
(57, 'zhTW', '靈魂收割者', '雖然只有少數人能掌控蘊藏在靈魂中的力量，但許多人都知道惡魔對死者靈魂共同的渴望。靈魂收割者與來自扭曲虛空的惡魔簽訂契約，成為它們的主人，並用敵人的靈魂供養它們，以換取無與倫比的力量。', 56647),
(59, 'zhTW', '崇魔者', '燃燒軍團的落敗讓許多強大的惡魔脫離束縛。崇魔者能夠操控一度被認為無法掌控的強大惡魔，並在戰場上釋出從扭曲虛空汲取的異界力量。', 56647);
