(73, 'zhTW', '第1賽季新內容！', '第1賽季開跑', '在傳奇難度地城和新的積分戰場閃擊戰中獲得獎勵！', '奈幽巴宮殿', '進攻安蘇芮克女王在阿茲-卡罕特的王座。', '澤克維爾巢穴', '在全新賽季探究內容中一路推進，解鎖澤克維爾巢穴。', 56647);
